    "2013-03-16T01:04:50.114353",nt"name": "energy-mineral-and-ground-water-resources-of-carbon-and-emery-counties-utah",nt"isopen":
    false,nt"url": null,nt"notes": "The Utah Geological Survey has collected
    and evaluated information on the known and potential energy, mineral, and ground-water
    resources in Carbon and Emery Counties.  This report provides information for use
    in both short- and longterm land-planning decisions, particularly at the county
    level, and an indication of the present and future economic impact of mineral and
    energy development.  The report discusses eight major commodity groups: (1) oil
    and gas, (2) coal and coal resin, (3) coal-bed methane, (4) other energy resources
    (oil-impregnated rock, oil shale, geothermal), (5) uranium and vanadium, (6) metallic
    minerals, (7) industrial rocks and minerals, and (8) ground-water resources.  In
    general, for each group or commodity within a group the following aspects are discussed:
    (1) known occurrences and characteristics, (2) past production and trends, (3) current
    production and exploration activity, and (4) geologic potential.  Plates accompany
    each of the major commodity groups and show the locations of known resources and
    areas of geologic potential.  In addition to the commodity discussions, the report
    contains a brief summary of land ownership status and concludes with a summary of
    commodities having the best potential for discovery and development.",nt"license_title":
